import './App.css';


function App() {
  return (
    <div className="App">
           <Button type='primary'>Hello</Button>
            <Radio.Group onChange={onChange} value={value}>
                <Radio value={1}>A</Radio>
                <Radio value={2}>B</Radio>
                <Radio value={3}>C</Radio>
                <Radio value={4}>D</Radio>
            </Radio.Group>
    </div>
  );
}

export default App;
